import React, { useState } from "react";
import { Link } from "react-router-dom";
import Defi from "./Defi";
import Exchnage from "./Exchnage";
import Favorites from "./Favorites";
import Heatmap from "./Heatmap";
import Tabledata from "./Tabledata";
import classes from "./shifting.module.css";
const Shifting = () => {
  const [val, setval] = useState("cryp");
  const renfun = (ab) => {
    setval(ab);
  };
  return (
    <div>
      <div
        className={`${classes.disp} container-fluid`}
        style={{ padding: "0 80px" }}
      >
        <div className="row">
          <div className="col-2" onClick={() => renfun("cryp")}>
            CRYPTO
          </div>
          <div className="col-2" onClick={() => renfun("exch")}>
            Exchanges
          </div>
          <div className="col-2" onClick={() => renfun("fav")}>
            FAVORITES
          </div>
          <div className="col-2" onClick={() => renfun("defi")}>
            DEFI
          </div>
          <div className="col-2" onClick={() => renfun("heat")}>
            HEATMAP
          </div>
        </div>
      </div>
      <div className={`dropdown ${classes.dropdow}`}>
        <button
          
          type="button"
          id="dropdownMenuButton"
          data-toggle="dropdown"
          aria-haspopup="true"
          aria-expanded="false"
          style={{borderRadius:"25px",backgroundColor:"white" ,}}
        >
          Dropdown button
        </button>
        <div className="dropdown-menu" aria-labelledby="dropdownMenuButton">
          <a className="dropdown-item"  onClick={() => renfun("cryp")}>
            crypto
          </a>
          <a className="dropdown-item"  onClick={() => renfun("exch")}>
            Exchange
          </a>
          <a className="dropdown-item"  onClick={() => renfun("fav")}>
            Favorite
          </a>
          <a className="dropdown-item"   onClick={() => renfun("defi")}>
            DEFI
          </a>
          <a className="dropdown-item"   onClick={() => renfun("heat")}>
            HEATMAP
          </a>
        </div>
      </div>

      <div>
        {val === "cryp" && <Tabledata />}
        {val === "exch" && <Exchnage />}
        {val === "fav" && <Favorites />}
        {val === "defi" && <Defi />}
        {val === "heat" && <Heatmap />}
        {/* {val === "cryp" && <tyytf></tyytf>} */}
      </div>
    </div>
  );
};

export default Shifting;
